// RestaurantInfo.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const RestaurantInfo = () => {
  const { id } = useParams();
  const [restaurant, setRestaurant] = useState(null);
  const [editing, setEditing] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    location: '',
    sortieType: '',
    cuisine: [],
    openingHours: '',
    menu: '',
  });
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchRestaurantInfo = async () => {
      try {
        const response = await fetch(`http://localhost:5000/restaurants/${id}`);
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        setRestaurant(data);
      } catch (error) {
        setError(error.message);
        console.error("There was a problem fetching the restaurant data:", error);
      }
    };

    fetchRestaurantInfo();
  }, [id]);

  if (error) {
    return <div>Error: {error}</div>;
  }

  if (!restaurant) {
    return <div>Loading...</div>;
  }


  useEffect(() => {
    if (restaurant) {
      setFormData({
        name: restaurant.name,
        location: restaurant.location,
        sortieType: restaurant.sortieType,
        cuisine: restaurant.cuisine.join(', '),
        openingHours: restaurant.openingHours,
        menu: restaurant.menu,
      });
    }
  }, [restaurant]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => ({
      ...prevFormData,
      [name]: value,
    }));
  };


  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`http://localhost:5000/restaurants/${id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          ...formData,
          cuisine: formData.cuisine.split(',').map(c => c.trim()), // convert string back to array
        }),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const updatedRestaurant = await response.json();
      setRestaurant(updatedRestaurant);
      setEditing(false); // hide the form again
    } catch (error) {
      setError(error.message);
      console.error("There was a problem updating the restaurant data:", error);
    }
  };

  return (
    <div>
<h1>{restaurant.name}</h1>
      <p><strong>ID:</strong> {restaurant._id}</p>
      {/* It's not recommended to display the password! */}
      <p><strong>Location:</strong> {restaurant.location}</p>
      <p><strong>Type:</strong> {restaurant.sortieType}</p>
      <p><strong>Cuisines:</strong> {restaurant.cuisine.join(', ')}</p>
      <p><strong>Opening Hours:</strong> {restaurant.openingHours}</p>
      <p><strong>Menu URL:</strong> <a href={restaurant.menu} target="_blank" rel="noopener noreferrer">View Menu</a></p>
      {/* Include any other information you might want to display */}      <button onClick={() => setEditing(true)}>Edit Info</button>
      {editing && (
        <form onSubmit={handleSubmit}>
          {/* Create form inputs for each attribute, example: */}
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
          />
          {/* Repeat for other attributes */}
          {/* ... */}
          <button type="submit">Update Restaurant</button>
        </form>
      )}
    </div>
  );
};

export default RestaurantInfo;
